import { TYPES } from '../../const';
import { Guitar, Types} from '../../types/types';

type DetailsTabProps = {
  guitar: Guitar,
}

type ChoiceTabProps = {
  type:string,
  TYPES:Types,
}

function Details({guitar}: DetailsTabProps): JSX.Element {
  const {vendorCode, type, stringCount} = guitar;
  const Choice = ({type , TYPES} :  ChoiceTabProps) => {
    const typ = TYPES[type];
    console.log(typ);
    return (
      typ
    );
  };
  return (
    <table className="tabs__table">
      <tbody >
        <tr className="tabs__table-row">
          <td className="tabs__title">Артикул:</td>
          <td className="tabs__value">{vendorCode}</td>
        </tr>
        <tr className="tabs__table-row">
          <td className="tabs__title">Тип:</td>
          <td className="tabs__value">{type ? Choice({type, TYPES}) : ''}</td>
        </tr>
        <tr className="tabs__table-row">
          <td className="tabs__title">Количество струн:</td>
          <td className="tabs__value">{stringCount} струнная</td>
        </tr>
      </tbody>
    </table>
  );
}

export default Details;
